<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <link
      rel="icon"
      href="https://img.icons8.com/external-flaticons-lineal-color-flat-icons/512/external-catering-award-events-flaticons-lineal-color-flat-icons.png"
    />
    <meta name="viewport" content="width=device-width,initial-scale=1" />
    <meta name="theme-color" content="#000000" />
    <meta
      name="description"
      content="One stop Catering destination for your parties and events."
    />
    <link rel="apple-touch-icon" href="/logo192.png" />
    <link rel="manifest" href="/manifest.json" />
    <title>CaterBid</title>
    <script defer="defer" src="/static/js/main.9c01cf5e.js"></script>
    <link href="/static/css/main.ed4d977c.css" rel="stylesheet" />
  </head>
  <body>
    <noscript>You need to enable JavaScript to run this app.</noscript>
    <script>
      "serviceWorker" in navigator &&
        window.addEventListener("load", function () {
          navigator.serviceWorker.register("serviceWorker.js").then(
            function (e) {
              console.log(
                "ServiceWorker registration successful with scope: ",
                e.scope
              );
            },
            function (e) {
              console.log("ServiceWorker registration failed: ", e);
            }
          );
        });
    </script>
    <div id="root"></div>
  </body>
</html>
